el\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"markdown","id":"51d67333","metadata":{"papermill":{"duration":0.022565,"end_time":"2023-12-27T10:32:53.611162","exception":false,"start_time":"2023-12-27T10:32:53.588597","status":"completed"},"tags":[]},"source":["# 8 - Plotting the sentiment scores in the map"]},{"cell_type":"code","execution_count":17,"id":"aa9ee6ee","metadata":{"execution":{"iopub.execute_input":"2023-12-27T10:32:53.658571Z","iopub.status.busy":"2023-12-27T10:32:53.656966Z","iopub.status.idle":"2023-12-27T10:32:54.623835Z","shell.execute_reply":"2023-12-27T10:32:54.620856Z"},"papermill":{"duration":0.995091,"end_time":"2023-12-27T10:32:54.628085","exception":false,"start_time":"2023-12-27T10:32:53.632994","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2ATZR8H8N/dZSdtk+5FW0pLJy1QNshQRBBFHCAoLlRcuBXBgYoTQdw40deN\nCgIKbhQRlb1KoYO2dNDS0p00acbdvX8ESu1IV0Lh+H7+ai6XZ6Vpv7l77jlGFEUCAAAAgLMf\n29MNAAAAAAD3QLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA\nAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAA\nkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA\nAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAA\nkAgEOwAAAACJQLADAAA